import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Box, Button, Flex, Input, Select, useColorMode, Table, Thead, Tbody, Tr, Th, Td, useToast } from "@chakra-ui/react";

export default function TokenOwnershipTable() {
  const [data, setData] = useState([]);
  const [formValues, setFormValues] = useState({
    owner: "",
    status: "unminted",
    claimedBy: "",
  });

  const { colorMode } = useColorMode();
  const toast = useToast();

  useEffect(() => {
    axios.get('/api/data')
      .then(res => setData(res.data))
      .catch(err => {
        console.error(err);
        toast({
          title: "Error fetching data.",
          description: err.message,
          status: "error",
          duration: 9000,
          isClosable: true,
        });
      });
  }, []);

  const handleChange = e => {
    setFormValues({
      ...formValues,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = e => {
    e.preventDefault();
    console.log(formValues);
    // Perform your search/filter operation here
  };

  return (
    <Box>

        <Flex mb="2">
        <form onSubmit={handleSubmit}>
          <Input name="owner" value={formValues.owner} onChange={handleChange} placeholder="Owner" mr="2" />
          <Select name="status" value={formValues.status} onChange={handleChange} mr="2">
            <option value="unminted">Unminted</option>
            <option value="minted">Minted</option>
            <option value="claimed">Claimed</option>
          </Select>
          <Input name="claimedBy" value={formValues.claimedBy} onChange={handleChange} placeholder="Claimed By" mr="2" />
          <Button type="submit">Search</Button>
          </form>
        </Flex>

      <Table variant="simple" colorScheme={colorMode === 'light' ? 'blackAlpha' : 'whiteAlpha'}>
        <Thead>
          <Tr>
            <Th>ID</Th>
            <Th>Created By</Th>
            <Th>Status</Th>
            <Th>Claimed By</Th>
            <Th>Created At</Th>
            <Th>Token ID</Th>
            <Th>Owner</Th>
            <Th>Internal Token ID</Th>
            <Th>Serial Number</Th>
            <Th>Contract</Th>
            <Th>Category</Th>
            <Th>Block Updated</Th>
          </Tr>
        </Thead>
        <Tbody>
          {data.map(row => (
            <Tr key={row.id}>
              <Td>{row.id}</Td>
              <Td>{row.createdBy}</Td>
              <Td>{row.status}</Td>
              <Td>{row.claimedBy}</Td>
              <Td>{row.created_at}</Td>
              <Td>{row.tokenId}</Td>
              <Td>{row.owner}</Td>
              <Td>{row.internalTokenId}</Td>
              <Td>{row.serialNumber}</Td>
              <Td>{row.contract}</Td>
              <Td>{row.category}</Td>
              <Td>{row.blockUpdated}</Td>
            </Tr>
          ))}
        </Tbody>
      </Table>
    </Box>
  );
}
